import React from 'react';
import { useSearchParams } from 'react-router-dom';

const [searchParams, setSearchParams] = useSearchParams();
const movieId = searchParams.get('id');

const About = () => {
  return (
    <React.Fragment>
        <p>{movieId}</p>
    </React.Fragment>
  );
};

export default About;
